import axios from 'axios';

export const getEnderecoPorCep = async (cep) => {
    try {
        let responsta = {};
       await axios.get(`https://viacep.com.br/ws/${cep}/json/`).then(response =>{
            responsta = response.data;
       });
        return responsta;
    } catch (error) {
      console.error(error);
    }
  }
